using Rubin
using Tests
using Elliptic
using HypergeometricFunctions
using Polylogarithms
using SpecialFunctions

@test integrate(x^3*log(c*x), x) == :(-1//16*x^4+1//4*x^4*log(c*x))
@test integrate(x^2*log(c*x), x) == :(-1//9*x^3+1//3*x^3*log(c*x))
@test integrate(x*log(c*x), x) == :(-1//4*x^2+(1/2)*x^2*log(c*x))
@test integrate(log(c*x), x) == :(-1x+x*log(c*x))
@test integrate(x^-1*log(c*x), x) == :((1/2)*log(c*x)^2)
@test integrate(x^-2*log(c*x), x) == :(-1*x^-1+-1*x^-1*log(c*x))
@test integrate(x^-3*log(c*x), x) == :(-1//4*x^-2+-1//2*x^-2*log(c*x))
@test integrate(x^3*log(c*x)^2, x) == :(1//32*x^4+-1//8*x^4*log(c*x)+1//4*x^4*log(c*x)^2)
@test integrate(x^2*log(c*x)^2, x) == :(2//27*x^3+-2//9*x^3*log(c*x)+1//3*x^3*log(c*x)^2)
@test integrate(x*log(c*x)^2, x) == :(1//4*x^2+(1/2)*x^2*log(c*x)^2+-1//2*x^2*log(c*x))
@test integrate(log(c*x)^2, x) == :(2x+x*log(c*x)^2+-2*x*log(c*x))
@test integrate(x^-1*log(c*x)^2, x) == :(1//3*log(c*x)^3)
@test integrate(x^-2*log(c*x)^2, x) == :(-2*x^-1+-1*x^-1*log(c*x)^2+-2*x^-1*log(c*x))
@test integrate(x^-3*log(c*x)^2, x) == :(-1//4*x^-2+-1//2*x^-2*log(c*x)^2+-1//2*x^-2*log(c*x))
@test integrate(x^3*log(c*x)^3, x) == :(-3//128*x^4+-3//16*x^4*log(c*x)^2+1//4*x^4*log(c*x)^3+3//32*x^4*log(c*x))
@test integrate(x^2*log(c*x)^3, x) == :(-2//27*x^3+-1//3*x^3*log(c*x)^2+1//3*x^3*log(c*x)^3+2//9*x^3*log(c*x))
@test integrate(x*log(c*x)^3, x) == :(-3//8*x^2+(1/2)*x^2*log(c*x)^3+-3//4*x^2*log(c*x)^2+3//4*x^2*log(c*x))
@test integrate(log(c*x)^3, x) == :(-6x+x*log(c*x)^3+-3*x*log(c*x)^2+6*x*log(c*x))
@test integrate(x^-1*log(c*x)^3, x) == :(1//4*log(c*x)^4)
@test integrate(x^-2*log(c*x)^3, x) == :(-6*x^-1+-1*x^-1*log(c*x)^3+-6*x^-1*log(c*x)+-3*x^-1*log(c*x)^2)
@test integrate(x^-3*log(c*x)^3, x) == :(-3//8*x^-2+-3//4*x^-2*log(c*x)^2+-3//4*x^-2*log(c*x)+-1//2*x^-2*log(c*x)^3)
@test integrate(x^3*log(c*x)^-1, x) == :(c^-4*expintegralei(4*log(c*x)))
@test integrate(x^2*log(c*x)^-1, x) == :(c^-3*expintegralei(3*log(c*x)))
@test integrate(x*log(c*x)^-1, x) == :(c^-2*expintegralei(2*log(c*x)))
@test integrate(log(c*x)^-1, x) == :(c^-1*logintegral(c*x))
@test integrate(x^-1*log(c*x)^-1, x) == :(log(log(c*x)))
@test integrate(x^-2*log(c*x)^-1, x) == :(c*expintegralei(-1*log(c*x)))
@test integrate(x^-3*log(c*x)^-1, x) == :(c^2*expintegralei(-2*log(c*x)))
@test integrate(x^3*log(c*x)^-2, x) == :(-1*x^4*log(c*x)^-1+4*c^-4*expintegralei(4*log(c*x)))
@test integrate(x^2*log(c*x)^-2, x) == :(-1*x^3*log(c*x)^-1+3*c^-3*expintegralei(3*log(c*x)))
@test integrate(x*log(c*x)^-2, x) == :(-1*x^2*log(c*x)^-1+2*c^-2*expintegralei(2*log(c*x)))
@test integrate(log(c*x)^-2, x) == :(c^-1*logintegral(c*x)+-1*x*log(c*x)^-1)
@test integrate(x^-1*log(c*x)^-2, x) == :(-1*log(c*x)^-1)
@test integrate(x^-2*log(c*x)^-2, x) == :(-1*c*expintegralei(-1*log(c*x))+-1*x^-1*log(c*x)^-1)
@test integrate(x^-3*log(c*x)^-2, x) == :(-1*x^-2*log(c*x)^-1+-2*c^2*expintegralei(-2*log(c*x)))
@test integrate(x^3*log(c*x)^-3, x) == :(-2*x^4*log(c*x)^-1+8*c^-4*expintegralei(4*log(c*x))+-1//2*x^4*log(c*x)^-2)
@test integrate(x^2*log(c*x)^-3, x) == :(-3//2*x^3*log(c*x)^-1+-1//2*x^3*log(c*x)^-2+9//2*c^-3*expintegralei(3*log(c*x)))
@test integrate(x*log(c*x)^-3, x) == :(-1*x^2*log(c*x)^-1+2*c^-2*expintegralei(2*log(c*x))+-1//2*x^2*log(c*x)^-2)
@test integrate(log(c*x)^-3, x) == :((1/2)*c^-1*logintegral(c*x)+-1//2*x*log(c*x)^-1+-1//2*x*log(c*x)^-2)
@test integrate(x^-1*log(c*x)^-3, x) == :(-1//2*log(c*x)^-2)
@test integrate(x^-2*log(c*x)^-3, x) == :((1/2)*c*expintegralei(-1*log(c*x))+(1/2)*x^-1*log(c*x)^-1+-1//2*x^-1*log(c*x)^-2)
@test integrate(x^-3*log(c*x)^-3, x) == :(x^-2*log(c*x)^-1+2*c^2*expintegralei(-2*log(c*x))+-1//2*x^-2*log(c*x)^-2)
@test integrate(x^3*(a+b*log(c*x^n)), x) == :(1//4*x^4*(a+b*log(c*x^n))+-1//16*b*n*x^4)
@test integrate(x^2*(a+b*log(c*x^n)), x) == :(1//3*x^3*(a+b*log(c*x^n))+-1//9*b*n*x^3)
@test integrate(x*(a+b*log(c*x^n)), x) == :((1/2)*x^2*(a+b*log(c*x^n))+-1//4*b*n*x^2)
