@test integrate(x^-3*(a+b*log(c*x^n)), x) == :(-1//2*x^-2*(a+b*log(c*x^n))+-1//4*b*n*x^-2)
@test integrate(x^3*(a+b*log(c*x^n))^2, x) == :(1//4*x^4*(a+b*log(c*x^n))^2+1//32*b^2*n^2*x^4+-1//8*b*n*x^4*(a+b*log(c*x^n)))
@test integrate(x^2*(a+b*log(c*x^n))^2, x) == :(1//3*x^3*(a+b*log(c*x^n))^2+2//27*b^2*n^2*x^3+-2//9*b*n*x^3*(a+b*log(c*x^n)))
@test integrate(x*(a+b*log(c*x^n))^2, x) == :((1/2)*x^2*(a+b*log(c*x^n))^2+1//4*b^2*n^2*x^2+-1//2*b*n*x^2*(a+b*log(c*x^n)))
