@test integrate(x^-3*(a+b*log(c*x^n))^2, x) == :(-1//2*x^-2*(a+b*log(c*x^n))^2+-1//4*b^2*n^2*x^-2+-1//2*b*n*x^-2*(a+b*log(c*x^n)))
@test integrate(x^3*(a+b*log(c*x^n))^3, x) == :(1//4*x^4*(a+b*log(c*x^n))^3+-3//128*b^3*n^3*x^4+-3//16*b*n*x^4*(a+b*log(c*x^n))^2+3//32*b^2*n^2*x^4*(a+b*log(c*x^n)))
@test integrate(x^2*(a+b*log(c*x^n))^3, x) == :(1//3*x^3*(a+b*log(c*x^n))^3+-2//27*b^3*n^3*x^3+-1//3*b*n*x^3*(a+b*log(c*x^n))^2+2//9*b^2*n^2*x^3*(a+b*log(c*x^n)))
